import './App.css';
import Properties from './components/Properties';
import { styled, createTheme, ThemeProvider} from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import MuiAppBar from '@mui/material/AppBar';
import Switch from '@mui/material/Switch';

import * as React from 'react';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));


const label = { inputProps: { 'aria-label': 'Switch demo' } };



const mdTheme = createTheme();

const AppBar = styled(MuiAppBar, {
  shouldForwardProp: (prop) => prop !== 'open',
})(({ theme, open }) => ({
  transition: theme.transitions.create(['width', 'margin'], {
    easing: theme.transitions.easing.sharp,
    duration: theme.transitions.duration.leavingScreen,
  }),
  ...(open && {
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  }),
}));

function App() {
  return (
    <ThemeProvider theme={mdTheme}>
      <Box sx={{ display: 'flex' }}>
        <CssBaseline />
        <AppBar position="absolute">
          <Toolbar
            sx={{
              pr: '25px', // keep right padding when drawer closed
            }}
          ><h1>Cadastro de imóveis</h1>
          </Toolbar>
            <Switch {...label} />
            </AppBar>
        <Properties />
      </Box>
         <div>
          <Toolbar
            sx={{
              pr: '24px', // keep right padding when drawer closed
            }}
          ><h2>Informaçoes sobre o imovel</h2>
          </Toolbar>
         <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2}>
        <Grid item xs={15}>
          <Item>loreeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeee</Item>
        </Grid>
        <Grid item xs={15}>
          <Item>loremmmmmamdm</Item>
        </Grid>
        <Grid item xs={15}>
          <Item>loreeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeeee</Item>
        </Grid>
        <Grid item xs={15}>
          <Item>loreeeeeeeeeeeeeeeeeeeeee</Item>
        </Grid>
      </Grid>
    </Box>
         </div>



    </ThemeProvider>
  );
}


export default App;
